INSERT INTO `myX`.`loca` VALUES(1, '', 'Olimpia: Templo de Zeus', 2, 1, 'El templo de Zeus en Olimpia albergaba la famosa estatua crisoelefantina del dios, obra del no menos famoso Fidias. Esta estatua era considerada como una de las siete maravillas del mundo antiguo', 3, "Archea Olimpia 270 65, Greece",'37.637932, 21.630238','37.637932, 21.630238', "odysseus.culture.gr", 2);
INSERT INTO `myX`.`loca` VALUES(2, '', 'Delfos: Templo de Apolo', 2, 1, 'El templo de Apolo en Delfos era el lugar central del santuario y donde tenía lugar el famoso oráculo', 3, '','38.482288, 22.501146','','',2);
INSERT INTO `myX`.`loca` VALUES(3, '', 'Éfeso: Templo de Artemisa', 1, 1, 'El templo de Artemisa en Éfeso era una de las siete maravillas del mundo antiguo', 3, '','37.949887, 27.363383','','',2);
INSERT INTO `myX`.`loca` VALUES(4, '', 'Atenas: Partenón', 2, 1, 'El Partenón de Atenas era una de las siete maravillas del mundo antiguo', 3, '','37.971482, 23.726625', '','',2);
INSERT INTO `myX`.`loca` VALUES(5, "", "Aphrodisias: Templo de Afrodita", 1, 1, "El templo de Afrodita es y sigue siendo el punto principal del sitio, pero el carácter del edificio se alteró cuando se convirtió en una basílica cristiana. Los escultores de Afrodisias eran célebres y se beneficiaron de una gran abundancia de mármol en las montañas cercanas. La escuela de escultura de la ciudad produjo bastantes obras, muchas de las cuales todavía se pueden apreciar en el sitio y en el museo de la ciudad. Durante las excavaciones se encontraron muchas estatuas completas en el área del ágora y estatuas sin terminar en un área que señala el sitio de una escuela de escultura. También se han hallado sarcófagos en varios puntos de la ciudad, la mayor parte de ellos con diseños que constan de guirnaldas y columnas, al igual que pilares con diseños descritos como «manuscritos humanos» o «vivientes», representando personas, pájaros y animales envueltos en hojas de acanto.<br />En el sitio arqueológico alrededor del templo se pueden encontrar rincones ideales para mantener sexo.", 3, "Geyre Mahallesi, Kuyucak Tavas Yolu, 09385 Karacasu/Aydın, Turkey", "37.710071, 28.725108", "", "www.muze.gov.tr/aphrodisias", 2);
INSERT INTO `myX`.`loca` VALUES(6, '', 'Sunio: Templo de Poseidón', 1, 1, 'El templo de Poseidón de Sunio era lo primero que veían los navegantes cuando se aproximaban al Ática', 3, '','37.650153, 24.024572','','',2);
